  const handleStartMyApp = () => {
    setMyAppVisible(true);
  };

  return (
    <div className="App" style={{ backgroundImage: `url('https://static1.squarespace.com/static/609290132f18e3054a6c8cb0/6092919d7454f86dae5f5b63/630e244687c1f8584f75c014/1665754067868/CRUSH_MUUVR_BRAND_GUIDES_0339.jpg?format=1500w')`, backgroundRepeat: 'no-repeat', backgroundSize: 'cover' }}>
 {!myAppVisible ? (
    <button onClick={handleStartMyApp} style={{ backgroundColor: 'purple', WebkitTextFillColor:'white'}}>
      get outfit
    </button>
 ) : (
    <HandleEvents />
 )}
</div>
  );
}

export default App;
